 tab and User enters value to all the input box in Shipping page\r\n\r\n  @Ignition\r\n  Scenario: Test scenario for entering values for Ignition, before that save all the values entered under all tabs, in Customer inq\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    Then User click on New button in ERP Customer Inq\r\n    Then User clicks on Save button before adding values to ignition\r\n    And User navigate to Ignition tab in ERP\r\n    Then User clicks on Create new button and standing PO popup appeared\r\n    And User selects 1 day from current date and 2 day from end date and Select Payment processing\r\n    Then PO has been saved in ERP\r\n    Then User selects time for order time for different days\r\n    And User selects Order taker from drop down\r\n    Then User clicks on Save button\r\n\r\n  @MultipleStandingPO\r\n  Scenario: Test scenario for creating multiple Standing PO\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    And User navigate to Ignition tab in ERP\r\n    Then User clicks on Create new button and standing PO popup appeared\r\n    And User selects 3 day from current date and 4 day from end date and Select Payment processing\r\n    Then PO has been saved in ERP\r\n    Then User clicks on Create new button and standing PO popup appeared\r\n    And User selects 5 day from current date and 6 day from end date and Select Payment processing\r\n    Then PO has been saved in ERP\r\n\r\n  @SearchPO\r\n  Scenario: Test scenario to search PO details in Ignition tab\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    And User navigate to Ignition tab in ERP\r\n    Then User enters PO in search box and user should make sure that PO details displayed in grid\r\n    And User c r must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    Then User clicks on Copy button and popup should display in ERP\r\n    And User should enter required details in ERP Copy popup and user should cancel copy\r\n\r\n  @CopyCustomerInq\r\n  Scenario: Test scenario for creating copy of customer inq\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    Then User clicks on Copy button and popup should display in ERP\r\n    And User should enter required details in ERP Copy popup\r\n\r\n  @CreateCopyForExistingCustomer\r\n  Scenario: Test scenario for creating copy of customer inq for existing customer\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    Then User click on New button in ERP Customer Inq for copy of customer inq\r\n    And User should select customer account# in customer inq in ERP\r\n      |Customer|\r\n    Then User clicks on Copy button and popup should display in ERP\r\n    And User should click on save button to save copy of customer inq in ERP\r\n\r\n  @CustomerNameRequiredPopup\r\n  Scenario: Test scenario for creating cancel of customer inq for existing customer\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    Then User click on New button to cancel creation of customer inq in ERP\r\n    And User enters value to all the input box in Main page\r\n    And User navigate to AR Rules tab and User enters value to all the input box in AR Rules page\r\n    And User navigate to Credit tab and User enters value to all the input box in Credit page\r\n    And User navigate to Billing Info tab and User enters value to all the input box in Billing Info page\r\n    And User navigate to Marketing tab and User enters value to all the input box in Marketing page\r\n    And User navigate to Pricing tab and User enters value to all the input box in Pricing page\r\n    And User navigate to Order entry tab and User enters value to all the input box in Order entry page\r\n    And User navigate to Shipping tab and User enters value to all the input box in Shipping page\r\n    Then User clicks on Save button without entering customer name in ERP env\r\n\r\n  @LoadCustomerDetails\r\n  Scenario: Test scenario for loading details of particular customer in cusomter inq\r\n    Given User must be on Client side and select Customer Inq in ERP\r\n    When User should confirm that he is in Customer Inq in ERP\r\n    And User should select customer account# in customer inq to load customer details in ERP\r\n      |Customer #|\r\n    And User should verify that values relevant to the customer has been loaded\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/IdeaProjects/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/CustomerInqFeature_ERPFeature/customerInqfeatureErp1.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Customer Inq in ERP","description":"  All the scenarios that performs all the scenarios related to Customer inq(ERP)","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"For login to application and select Customer inq ERP","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"User enters URL and is on login page and entered credentials Customer inq ERP","id":"803df13c-b280-45a4-993b-e6824bb794a3"},{"location":{"line":6,"column":5},"keyword":"When ","text":"User is on Home Page for Customer inq ERP","id":"4ed5bd54-39ab-4ebe-a6c2-0909ee2b3165"},{"location":{"line":7,"column":5},"keyword":"Then ","text":"User navigate to Client side for Customer inq ERP","id":"5708b3eb-f208-43f2-b47e-041c
